import React from "react";
import img from "../../images/meme.jpg";

import { Back } from "./NotFoundElements";

const PageNotFound = () => {
  return (
    <>
      <Back style={{ backgroundImage: `url(${img})` }}>
        404, Page not found!
      </Back>
    </>
  );
};

export default PageNotFound;
